import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './MainPage.css';
import logo from './logo.png'; // Update with the correct path if necessary
import image1 from './image1.png';
import image2 from './image2.png';
import image3 from './image3.png';

const MainPage = () => {
  const [activeSection, setActiveSection] = useState(null);
  const [currentSlide, setCurrentSlide] = useState(0);
  const navigate = useNavigate();

  const slides = [image1, image2, image3]; // Images for the slideshow

  const handleSectionClick = (section) => {
    setActiveSection(activeSection === section ? null : section);
  };

  const handleRoleClick = (role) => {
    navigate(`/${role}`);
  };

  // Auto slideshow effect
  useEffect(() => {
    const slideInterval = setInterval(() => {
      setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
    }, 3000); // Change slide every 3 seconds

    return () => clearInterval(slideInterval); // Clear interval on component unmount
  }, [slides.length]);

  return (
    <div className="main-page">
      {/* Header with logo and navigation links */}
      <header className="taskbar">
        <div className="logo-container">
          <img src={logo} alt="Jaypee Hospital Logo" className="logo" />
          <h1 className="hospital-name">Jaypee Hospital</h1>
        </div>
        <nav className="nav-bar">
          <ul className="nav-list">
            <li onClick={() => handleSectionClick('about')}>About Us</li>
            <li onClick={() => handleSectionClick('contact')}>Contact Us</li>
            <li onClick={() => handleSectionClick('locations')}>Locations</li>
          </ul>
        </nav>
      </header>

      {/* Dynamic Content */}
      <div className="dynamic-content">
        {activeSection === 'about' && (
          <div className="section-content">
            <h2>About Us</h2>
            <p>Welcome to Jaypee Hospital! We are committed to providing top-quality care with advanced medical technology and compassionate service.</p>
          </div>
        )}
        {activeSection === 'contact' && (
          <div className="section-content">
            <h2>Contact Us</h2>
            <p>Phone: 1800 102 9103<br />Email: contact@jaypeehospital.com</p>
          </div>
        )}
        {activeSection === 'locations' && (
          <div className="section-content">
            <h2>Locations</h2>
            <p>Find us in New Delhi, Mumbai, and Bengaluru.</p>
          </div>
        )}
      </div>

      {/* Slideshow Section */}
      <div className="slideshow-container">
        {slides.map((slide, index) => (
          <div
            key={index}
            className={`slide ${index === currentSlide ? 'active' : ''}`}
          >
            <img src={slide} alt={`Slide ${index + 1}`} className="slide-image" />
          </div>
        ))}
      </div>

      {/* Main Content with Role Options */}
      <div className="main-content">
        <h1 className="welcome-text">Welcome to the Hospital Portal</h1>
        <div className="role-buttons">
          <button className="role-button" onClick={() => handleRoleClick('nurse')}>Nurse</button>
          <button className="role-button" onClick={() => handleRoleClick('junior-doctor')}>Junior Doctor</button>
          <button className="role-button" onClick={() => handleRoleClick('senior-doctor')}>Senior Doctor</button>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
